import React from 'react';

export const CoperHome = () => {
  return(<>
    <p>서비스 준비중</p>
    <p>불특정 다수가 하나의 프로젝트에 참여하여 창출된 결과물을 NFT로 제작하여 유통/분배 하는 서비스입니다</p>
  </>)
}
